import * as React from 'react';
import './multiLevelDropdownMenu.scss';

const titles = [
  {
    title: 'tab1',
    submenu: [
      {
        title: 'subtitle1',
      },
      {
        title: 'subtitle2',
      },
      {
        title: 'subtitle3',
      },
    ],
  },
  {
    title: 'tab2',
  },
  {
    title: 'tab3',
  },
];
const MultiLevelDropdownMenu: React.FC = () => {
  return (
    <div className={'multi-level-dropdown-menu-wrapper'}>
      <ul className="tabs">
        {titles.map(({ title }) => (
          <li key={title} className="tab">
            {title}
          </li>
        ))}
      </ul>
    </div>
  );
};

export { MultiLevelDropdownMenu };
